import React, {useState, useEffect} from 'react'
import { role } from '../constant/constant'

const Home = (props) => {
  const [text, setText] = useState('');
  
  useEffect(() => {
    if (props.role === role.ADMIN) {
      setText('Admin');
    } else if (props.role === role.EXPERT) {
      setText('Expert');
    } else {
      setText('Guest');
    }
  }, [props.role]);

  return (
    <div className='text-center'>{text}</div>
  )
}

export default Home;
